import React from "react";
import Navbar from "./Navbar";
import Card from "./Card";
import data from "../data";
import everest from "../img/everest.png";

const cards = data.map((item) => {
  return (
    <Card
      title="Mount Everest"
      img={everest}
      location="Nepal"
      startDate="12 Jan, 2023"
      endDate="24 Jan, 2023"
      description="Mount Everest is Earth's highest mountain above sea level, located in the Mahalangur Himal sub-range of the Himalayas"
    />
  );
});
function App() {
  return (
    <div>
      <Navbar />
      <Card
        title="Mount Everest"
        img={everest}
        location="Nepal"
        startDate="12 Jan, 2023"
        endDate="24 Jan, 2023"
        description="Mount Everest is Earth's highest mountain above sea level, located in the Mahalangur Himal sub-range of the Himalayas"
      />
    </div>
  );
}

export default App;
